アルコール除菌 ウェットタオル 20枚<br>ブランド：服部製紙<br>販売・製造元：服部製紙<br>手指などの身のまわりの除菌に便利な除菌用ウェットタオルです。<br>拭くだけで簡単に除菌が出来ます。<br>天然フルコール・天然除菌成分・天然消臭成分配合。<br>ふんわり厚手でソフトな使用感です。<br>たっぷり拭ける大判サイズ。<br>手・指の除菌や身のまわりのものの除菌に。<br>外出先、旅行、アウトドアに適しています。<br> <br><br>使用方法<br>表面のシールをめくり、1枚ずつ取り出してご使用下さい。<br> <br>使用上の注意<br>●用途以外には使用しないで下さい。<br>●お肌に異常を感じた時は使用を中止し、医師に相談して下さい。<br>●火気の近くで使用・保管をしないで下さい。<br>●アルコール過敏症の方や肌が弱い方が使用される場合、また長時間使用される場合は肌荒れの恐れがありますので注意して下さい。<br>●目や口など皮膚粘膜や傷口には使用しないで下さい。<br>●幼児の手の届くところ、日の当たる所、及び高温になる場所には置かないで下さい。<br>●水に溶けませんので、トイレには流さないで下さい。<br>●ペンキや漆塗り、ニス塗り、ワックスの塗装面、白木、桐、皮革、壁紙面、アクリル製やスチロール製のプラスチックには使用しないで下さい。<br>●中身の乾燥を防ぐため、ご使用後は取り出し口のフタは必ずきちんと閉めて下さい。<br>●品質保持のため、開封後は3ヶ月程度で使い切って下さい。<br>*本品は拭き取った後の菌を減少させるもので、全ての菌を除去するものではありません。<br> <br>成分<br>水、エタノール、緑茶リキッド、グレープフルーツ種子エキス<br> 原産国日本 <br>お問い合わせ先<br>服部製紙株式会社0120-089614受付時間 9：00-17：00(土日・祝祭日を除く) <br>衛生医療／殺菌・消毒／除菌／除菌用ウェットタオル<br>JANコード： 4976861002940<br>cs：96<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
